import React from 'react';
import Toolbar from './components/Toolbar';
import Canvas from './components/Canvas';

function App() {
  return (
    <div className="App">
      <h1>MindMine</h1>
      <Toolbar />
      <Canvas />
    </div>
  );
}

export default App;
